open System.Collections.Generic

// https://riptutorial.com/fsharp/example/29649/memoization-in-a-recursive-function
let memorec f =
    let memo = Dictionary<_, _>()

    let rec frec a =
        match memo.TryGetValue a with
        | exist, value when exist -> value
        | _ ->
            let value = f frec a
            memo.Add(a, value)
            value

    frec

let mex (l: list<int>) =
    let l = l |> List.sort |> List.distinct
    let m = List.length l
    l
    |> List.indexed
    |> List.tryFindIndex (fun (i, x) -> i <> x)
    |> Option.defaultValue m

let f =
    fun calculateGrundy (w, b) ->
        if w = 0 && b <= 1 then
            0
        else
            if w = 0 then [] else [ calculateGrundy (w - 1, b + w) ]
            |> List.append ([ 1 .. (b / 2) ] |> List.map (fun k -> calculateGrundy (w, b - k)))
            |> mex

